// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;
import "../Utils.sol";

contract PoolSoccer {
    uint256 private pool_id;
    constructor() {
        pool_id = Utils.generate_unique_id("pool");
    }

    function get_id() external view returns (uint256) {
        return pool_id;
    }

    function deposit() external {}

    function withdraw() external {}
}

src/state/StateSoccer.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;

contract StateSoccer {
  string private team1;
  string private team2;
  address[] private composes;

  constructor(string memory _team1, string memory _team2, address[] memory _composes) {
    team1 = _team1;
    team2 = _team2;
    composes = _composes;
  }

  function get_names() public view returns (string memory, string memory) {
    return (team1, team2);
  }

  function get_compose() public view returns (address[] memory) {
    return composes;
  }
}

src/Utils.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;

library Utils {
    function generate_unique_id(string memory type_contract) internal view returns (uint256) {
        bytes32 hash = keccak256(abi.encodePacked(block.timestamp, block.number, msg.sender, address(this), type_contract));
        uint256 id = uint256(hash);
        return id;
    }
}

